    public class func drawBombCount(frame frame: CGRect, numBombs: String) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()


        //// Variable Declarations
        let bombTextColour = numBombs == "0" ? MineHuntImages.whiteColour : (numBombs == "1" ? MineHuntImages.blackColour : (numBombs == "2" ? MineHuntImages.blueColour : (numBombs == "3" ? MineHuntImages.greenColour : (numBombs == "4" ? MineHuntImages.yellowColour : MineHuntImages.redColour))))

        //// Symbol Drawing
        let symbolRect = CGRectMake(frame.minX + floor(frame.width * 0.00000 + 0.5), frame.minY + floor(frame.height * 0.00000 + 0.5), floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)

        MineHuntImages.drawEmpty(frame: CGRectMake(0, 0, symbolRect.size.width, symbolRect.size.height))
        CGContextRestoreGState(context)


        //// Text Drawing
        let textRect = CGRectMake(frame.minX + floor(frame.width * 0.12500 + 0.5), frame.minY + floor(frame.height * 0.10000 + 0.5), floor(frame.width * 0.90000 + 0.5) - floor(frame.width * 0.12500 + 0.5), floor(frame.height * 0.87500 + 0.5) - floor(frame.height * 0.10000 + 0.5))
        let textPath = UIBezierPath(rect: textRect)
        MineHuntImages.whiteColour.setFill()
        textPath.fill()
        CGContextSaveGState(context)
        CGContextSetShadowWithColor(context, MineHuntImages.shadow.shadowOffset, MineHuntImages.shadow.shadowBlurRadius, (MineHuntImages.shadow.shadowColor as! UIColor).CGColor)
        let textStyle = NSParagraphStyle.defaultParagraphStyle().mutableCopy() as! NSMutableParagraphStyle
        textStyle.alignment = NSTextAlignment.Center

        
        
        let label : UILabel = UILabel(frame: textRect)
        label.text = numBombs
        var largestFontSize : CGFloat  = 50
 
        while numBombs.sizeWithAttributes([NSFontAttributeName: UIFont.systemFontOfSize(largestFontSize)]).width > (textRect.size.width / 2) {
            --largestFontSize
        }
        
        let textFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(largestFontSize), NSForegroundColorAttributeName: bombTextColour, NSParagraphStyleAttributeName: textStyle]

        let textTextHeight: CGFloat = NSString(string: numBombs).boundingRectWithSize(CGSizeMake(textRect.width, CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: textFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, textRect);
        NSString(string: numBombs).drawInRect(CGRectMake(textRect.minX, textRect.minY + (textRect.height - textTextHeight) / 2, textRect.width, textTextHeight), withAttributes: textFontAttributes)
        CGContextRestoreGState(context)
        CGContextRestoreGState(context)
    }

