    public class func drawWon(frame frame: CGRect) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Symbol Drawing
        let symbolRect = CGRectMake(frame.minX + floor(frame.width * 0.00000 + 0.5), frame.minY + floor(frame.height * 0.00000 + 0.5), floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)

        MineHuntImages.drawButton(frame: CGRectMake(0, 0, symbolRect.size.width, symbolRect.size.height))
        CGContextRestoreGState(context)


        //// Text Drawing
        let textPath = UIBezierPath()
        textPath.moveToPoint(CGPointMake(frame.minX + 0.14661 * frame.width, frame.minY + 0.29136 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.16549 * frame.width, frame.minY + 0.29136 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.19983 * frame.width, frame.minY + 0.46372 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.23417 * frame.width, frame.minY + 0.29136 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.25313 * frame.width, frame.minY + 0.29136 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.20797 * frame.width, frame.minY + 0.50547 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.20797 * frame.width, frame.minY + 0.65000 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.19177 * frame.width, frame.minY + 0.65000 * frame.height))
        textPath.addLineToPoint(CGPointMake(frame.minX + 0.19177 * frame.width, frame.minY + 0.50547 * frame.height))
